import React from 'react';
import Button from './Button';
import Input from './Input';

class Calculator extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			value1: null,
			value2: null,
			answer: null,
			isSecond: false
		};
	}

	render() {
		return (
			<div>
				<Input />
				<div className = "row">
					<Button value = {1}/>
					<Button value = {2} />
					<Button value = {3} />
					<Button value = {4} />
					<Button value = {5} />
					<Button value = {6} />
					<Button value = {7} />
					<Button value = {8} />
					<Button value = {9} />
					<Button value = {0} />
					<Button value = {'-'} />
					<Button value = {'+'} />
					<Button value = {'*'} />
					<Button value = {'/'} />	
					<Button value = {'='} />	
				</div>
			</div>
		);
	}
}

export default Calculator;
